# Hàm kiểm tra quyền admin
def is_admin():
    """Kiểm tra xem chương trình có đang chạy với quyền quản trị viên không."""
    if os.name == 'nt':
        try:
            return ctypes.windll.shell32.IsUserAnAdmin()
        except Exception:
            return False
    return False

# Hàm khởi chạy lại chương trình với quyền admin và thoát tiến trình hiện tại
def run_as_admin_and_exit_current():
    """Khởi chạy lại script Python hiện tại với quyền Admin và thoát tiến trình hiện tại."""
    if os.name != 'nt':
        return

    lp_file = sys.executable
    script_path = os.path.abspath(sys.argv[0])
    current_args = [f'"{arg}"' for arg in sys.argv[1:] if arg != '--runas-elevated']
    params = f'"{script_path}" {" ".join(current_args)} --runas-elevated'

    try:
        result = ctypes.windll.shell32.ShellExecuteW(
            None,
            'runas',
            lp_file,
            params,
            None,
            SW_HIDE
        )

        if result > 32: # Mã lỗi thành công là lớn hơn 32
            sys.exit(0) # Thoát tiến trình hiện tại ngay lập tức
        else:
            error_code_map = {
                0: "Lỗi hệ điều hành (thường do thiếu bộ nhớ hoặc tài nguyên)",
                2: "Không tìm thấy file hoặc đường dẫn",
                3: "Không tìm thấy đường dẫn",
                5: "Bạn đã từ chối yêu cầu kiểm soát tài khoản người dùng (UAC)",
                8: "Không đủ bộ nhớ",
                # Các mã lỗi khác có thể tra cứu ShellExecute documentation
            }
            error_description = error_code_map.get(result, f"Lỗi không xác định (mã: {result})")

            error_message = (
                f"Chương trình yêu cầu quyền quản trị để hoạt động.\n"
                f"Lỗi: {error_description}.\n"
                "Vui lòng chạy lại chương trình và chấp nhận yêu cầu UAC khi cửa sổ bật lên.\n"
                "Nếu vẫn gặp lỗi, hãy nhấp chuột phải vào file và chọn 'Run as administrator'."
            )
            messagebox.showerror("Lỗi Quyền Admin", error_message)
            sys.exit(1) # Thoát nếu có lỗi hoặc UAC bị từ chối
    except Exception as e:
        messagebox.showerror("Lỗi Quyền Admin", f"Đã xảy ra lỗi không mong muốn khi yêu cầu quyền: {e}\nChương trình sẽ thoát.")
        sys.exit(1)

